export const compareTimes = (time) => {
    let time_now = moment(new Date());
    time = moment(time, "hh:mm A");
    if (time_now.isBefore(time)) {
        // nếu > thời gian hiện tại => false
        return false;
    } else {
        return true; // nếu không thì true.
    }
};
