export const convertSeats = (data) => {
    let count = 0;
    let idx = 0;
    let newSeats = data.map((seat, index) => {
        count += 1;
        if (count === 21) {
            count = 1;
            idx += 1;
        }
        return {
            ...seat,
            decode_seat: `${rows[idx]}${count}`,
            isSelected: false,
        };
    });
    return newSeats;
};

